import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Dropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Targets = () => {
  const handleSelect1 = (eventKey) => {
    // Handle the selected item here if needed
    console.log(`Item with event key "${eventKey}" selected.`);
  };

  return (
    <Dropdown>
      <Dropdown.Toggle variant="danger" id="dropdown-basic">
        Please Select A Target
      </Dropdown.Toggle>

      <Dropdown.Menu>
        <Dropdown.Item onSelect={() => handleSelect1(1)}>
          <Link to="/Davis" style={{ textDecoration: 'none', color: 'inherit' }}>
            Davis
          </Link>
        </Dropdown.Item>
        <Dropdown.Item onSelect={() => handleSelect1(2)}>
          <Link to="/Maow" style={{ textDecoration: 'none', color: 'inherit' }}>
            Maow
          </Link>
        </Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );
};

export default Targets;
